import "./SingleCard.css";
const SingleCard = (props) => {
  const handleClick = () => {
    props.handleChoice(card);
  };

  return (
    <div className="card">
      <img className="front" src={props.card.src} alt="card front" />
      <img
        className="back"
        src="img/cover.png"
        alt="card back"
        onClick={handleClick}
      />
    </div>
  );
};
export default SingleCard;
